import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route
} from 'react-router-dom';

import Principal from './Principal';

const PagesRoot = () => (
    <Router>
        <StoreProvider>
            <Switch>
                <Route path="/" component={Principal} />
            </Switch>
        </StoreProvider>
    </Router>
);

export default PagesRoot;
